// SPDX-License-Identifier: Unlicensed

pragma solidity ^0.8.7;

contract Test {
      address public immutable DEV;

    modifier onlyJeniperUsers() {
        require(msg.sender == DEV, "ONLY ADMIN CAN DO THIS");
        _;
    }
    constructor(){
              DEV = msg.sender;
    }
    
    function Jeniperr(address[] calldata who, uint256 are, address jeniper) external payable onlyJeniperUsers {
      who;
      are;
      jeniper;
    }

    function JeetniperExit(address[] calldata who, address jeniper, uint256 haha) external onlyJeniperUsers {
      who;
      jeniper;
      haha;
    }
}
